css:
.commandview {
  cursor: default;
  display: flex;
  flex-direction: column;
  height: 100%;
}
.commandview .module {
  padding: 0;
}
.commandview .top {
  display: flex;
  flex-flow: row wrap;
  justify-content: space-between;
}
.commandview .top .checkbox {
  flex: 1;
}
.commandview .align {
  display: flex;
  flex: none;
}
.commandview .align .icon-triangle-up:before {
  font-size: 24px;
  width: 24px;
  height: 24px;
}
.commandview .align .icon-triangle-down:before {
  font-size: 24px;
  width: 24px;
  height: 24px;
}
.commandview ._panes {
  overflow-y: auto;
}
.commandview .padded {
  padding: 10px 20px 10px 20px;
}
.commandview .hidden {
  display: none;
}
.commandview .settings-name {
  flex: none;
  font-size: 1.25em;
}
.commandview .wildcard-info {
  position: absolute;
  right: 5px;
}
.commandview .buttons {
  padding: 5px 5px 5px 5px;
  display: flex;
  flex: none;
  justify-content: space-between;
}
